SBQQ__Formula__c:
IF(
    AND(
        !ISBLANK( SBQQ__SubscriptionPercent__c ) ,
        SBQQ__ProductName__c != 'Visibility Site License' , 
        fml_QuoteIsEarlyRenewal__c = FALSE,
        ISPICKVAL( SBQQ__Quote__r.SBQQ__Type__c , 'Amendment') ,
        fml_SubscriptionQuantity__c > 0
    ) ,

    IF(

/* Amend Context and Validates if TCV < 25k/100k and returns Previous List Price, else returns rollup * % of net tcv */

        AND(
            !RemoveMinimumPrice__c , 
            IncludeInPercentOfTotalRollup__c * CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 0.15 , 'PSSGLD-SE-SS-CPQ' , 0.2 , 0.1 ) + BLANKVALUE( SBQQ__UpgradedSubscription__r.Subscription_MRR_Excluding_Maintenance__c , 0) * 12 * CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 0.15 , 'PSSGLD-SE-SS-CPQ' , 0.2 , 0.1 ) <= CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 25000 , 'PSSGLD-SE-SS-CPQ' , 100000 , 5000 ) 
        ) ,

        SBQQ__UpgradedSubscription__r.SBQQ__CustomerPrice__c / (1 - BLANKVALUE( TotalDiscountCustom__c , 0) ) / Original_Quote_Prorate_Multiplier__c ,

        IF( 
            SBQQ__SubscriptionPercent__c = 0,      /* Amend Context and Ensures Expert Services with 0% add on shift/retain net price */
            SBQQ__UpgradedSubscription__r.SBQQ__CustomerPrice__c / (1 - BLANKVALUE( TotalDiscountCustom__c , 0) ) / Original_Quote_Prorate_Multiplier__c ,
            SBQQ__SubscriptionPercent__c * 
            (
            IncludeInPercentOfTotalRollup__c -
            IF(
                AND( 
                    fml_PercentOfTotalMinPriceAdjustment__c > 0,
                    !RemoveMinimumPrice__c ,   /* Note Adjustment is only for shift from Minimum Price -> % of Total ARR Pricing */
                    BLANKVALUE( SBQQ__UpgradedSubscription__r.Subscription_MRR_Excluding_Maintenance__c , 0) * 12 * CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 0.15 , 'PSSGLD-SE-SS-CPQ' , 0.2 , 0.1 ) <= CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 25000 , 'PSSGLD-SE-SS-CPQ' , 100000 , 5000 ) 
                ),                  
                fml_PercentOfTotalMinPriceAdjustment__c, 0
            )
            ) + SBQQ__UpgradedSubscription__r.SBQQ__CustomerPrice__c / (1 - BLANKVALUE( TotalDiscountCustom__c , 0) ) / Original_Quote_Prorate_Multiplier__c

                /* IncludeInPercentOfTotalRollup__c is prorated + Subscription List Price */

        )
    ) , /* End of initial IF Amend conditions, to Else for New Busines/Renewals */

    IF( 
        /* This is NewBusiness/Renewal and Validates if Quote > 25k/100k and returns percent of total price, else returns original list price */

        OR(
            RemoveMinimumPrice__c ,
            IncludeInPercentOfTotalRollup__c * CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 0.15 , 'PSSGLD-SE-SS-CPQ' , 0.2 , 0.1 ) >= CASE ( ParentOptionProductCode__c , 'PSSSLV-SE-SS-CPQ' , 25000 , 'PSSGLD-SE-SS-CPQ' , 100000 , 5000 ) 
        ) ,
        SBQQ__SubscriptionPercent__c * IncludeInPercentOfTotalRollup__c ,
        SBQQ__OriginalPrice__c
    )
)

IF(
ISPICKVAL(SBQQ__Type__c, 'Quote') || ISPICKVAL(SBQQ__Type__c, 'Renewal') || (ISPICKVAL(SBQQ__Type__c, 'Amendment') && EarlyRenewal__c),
SBQQ__SubscriptionTerm__c + IF(AND(NonAnnual__c, 

/* There is at least a 7 year difference between the 2 years Ex: 2096 - 2103*/
IF (OR(AND(MONTH(SBQQ__EndDate__c) = 2, DAY(SBQQ__EndDate__c)=29), /*BAED-2044*/
     YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) >= 7),
    TRUE,
  
  /* Start Date is a leap year */
    IF((MOD(YEAR(SBQQ__StartDate__c),4) = 0 && (MOD(YEAR(SBQQ__StartDate__c),100) != 0 || MOD(YEAR(SBQQ__StartDate__c),400) = 0)), 
        MONTH(SBQQ__StartDate__c) < 3,
       
 /* End Date is a leap year */
        IF ((MOD(YEAR(SBQQ__EndDate__c),4) = 0 && (MOD(YEAR(SBQQ__EndDate__c),100) != 0 || MOD(YEAR(SBQQ__EndDate__c),400) = 0)),
            MONTH(SBQQ__EndDate__c) > 2,
            OR(
               
 /* Diff between Start Date and End Date is 1 year and that year is a leap year */
                (YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) = 2  && MOD(YEAR(SBQQ__StartDate__c)+1,4) = 0 && (MOD(YEAR(SBQQ__StartDate__c)+1,100) != 0 || MOD(YEAR(SBQQ__StartDate__c)+1,400) = 0)),
                
/* There is at least a 3 year difference between the 2 years Ex: 2094 - 2100 AND account for the year having to be divisible by 400 if div by 100*/

                ((YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) >= 3) && ( ( MOD(YEAR(SBQQ__StartDate__c),100) >=4 && MOD(YEAR(SBQQ__StartDate__c),100) <= 96) || MOD(YEAR(SBQQ__EndDate__c),100) >= 4 ))
            )
        )
    )
)) ,1,0),

IF(ISPICKVAL(SBQQ__Type__c, 'Amendment') && EarlyRenewal__c = FALSE,
SBQQ__MasterContract__r.ContractTerm,0))

(SBQQ__EndDate__c - SBQQ__StartDate__c) + IF(/* There is at least a 7 year difference between the 2 years Ex: 2096 - 2103*/
IF (OR(AND(MONTH(SBQQ__EndDate__c) = 2, DAY(SBQQ__EndDate__c)=29), /*BAED-2044*/
YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) >= 7),
TRUE,
/* Start Date is a leap year */
IF((MOD(YEAR(SBQQ__StartDate__c),4) = 0 && (MOD(YEAR(SBQQ__StartDate__c),100) != 0 || MOD(YEAR(SBQQ__StartDate__c),400) = 0)),
MONTH(SBQQ__StartDate__c) < 3,
/* End Date is a leap year */
IF ((MOD(YEAR(SBQQ__EndDate__c),4) = 0 && (MOD(YEAR(SBQQ__EndDate__c),100) != 0 || MOD(YEAR(SBQQ__EndDate__c),400) = 0)),
MONTH(SBQQ__EndDate__c) > 2,
OR(
/* Diff between Start Date and End Date is 1 year and that year is a leap year */
(YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) = 2 && MOD(YEAR(SBQQ__StartDate__c)+1,4) = 0 && (MOD(YEAR(SBQQ__StartDate__c)+1,100) != 0 || MOD(YEAR(SBQQ__StartDate__c)+1,400) = 0)),
/* There is at least a 3 year difference between the 2 years Ex: 2094 - 2100 AND account for the year having to be divisible by 400 if div by 100*/
((YEAR(SBQQ__EndDate__c) - YEAR(SBQQ__StartDate__c) >= 3) && ( ( MOD(YEAR(SBQQ__StartDate__c),100) >=4 && MOD(YEAR(SBQQ__StartDate__c),100) <= 96) || MOD(YEAR(SBQQ__EndDate__c),100) >= 4 ))
)
)
)
) ,0,1)

IF (SBQQ__Quantity__c != 0,
    IF (AND(	Tiered_Product__c,NOT(ISBLANK(SBQQ__DiscountSchedule__c))),
        Calculated_MRR__c,
        IF (OR(IsTraining__c,IsService__c),
            0,
            IF (NOT(ISBLANK(SBQQ__UpgradedSubscription__c)),
                SBQQ__UpgradedSubscription__r.Zuora_MRR__c/SBQQ__UpgradedSubscription__r.SBQQ__Quantity__c,
                IF (NOT(ISBLANK(SBQQ__RenewedSubscription__c)),
                    SBQQ__RenewedSubscription__r.Zuora_MRR__c/SBQQ__RenewedSubscription__r.SBQQ__Quantity__c,
                    SBQQ__ListPrice__c * (1- TotalDiscountCustom__c)/12
                )
            )
        )
    ) * SBQQ__Quantity__c,
    0
)
